<td width="50%"><h4 class="mvgrey">Networkable Digital Signage Player</h4>
<p class="mvgrey">Introducing, Mvix Ceeno digital signage player, a LAN-based and Web-based Digital Signage Content Management System. The Bundled Windows-based Software enables file transfer and playlist management of digital media files(JPEG, MP3, MPEG1/2/4) â€“ all controllable from your internal network. The player also features an independent mode operation to allow for continuous playback regardless of network connection.</p></td>
<td width="50%"><h4 class="mvgrey">Comprehensive Connectivity</h4>
<p class="mvgrey"> Mvix is equipped with a versatile set of I/O options. It allows upto 720p/1080i video playback over Component Video out port (YPbPr), audio over stereo analog port and data connectivity over 10/100 network port. Media can be transferred via a network connection, FTP or even a simply. Operationally, media is transferred to a Ultra speed Compact Flash card for independent operation.</p></td>
</tr>
<tr>
<td><span style="text-align: center;"><img alt="Signage in Convenience Stores" src="http://www.mvixusa.com/images/digitalsignage/signage_convenience_store.jpg" style="width: 287px; height: 222px;"></span></td>
<td><h4 class="mvgrey">Fully-loaded Client Administration Tool</h4>
<p class="mvgrey">Mvix Ceeno comes bundled with a simple to use Win-based Client Administration tool (CAT). <em>No additional licensing or subscription cost</em>. This tool can be installed on any Windows-based PC to control and manage all digital signage players on the network. This comprehensive tool can handle dozens of digital signage players on the network and control media playback, RSS scrolling, playlist scheduling all from one location.</p></td>
</tr>
<tr>
<td>
<h4 class="mvgrey">Small Size and Low Power Consumption</h4>
<span class="mvgrey"> Measuring almost the size of a textbook or a ream of paper,
this 135 x 105 x 30mm device makes ideally suitable for LCD
displays. It can be mounted on the wall or the back-panel of
your LCD / Plasma. Combined with spectacular picture
quality of HD video and crystal clear sound clarity, Ceeno
comes with an extremely low operational cost. It consumes
no more than 15W (compared to a standard PC consuming
300-400W min). This reduction in power consumption and
operational cost makes it environmentally friendly!</span></td>
<td><h4 class="mvgrey">Suggested Applications</h4>
