INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (161482686844,'Arrow Tagging and Labelling Gun with Tagging Cables (approx. 2,300) EX',11890,'29601','Verenigde Staten','US','collectibleadventures','13.95','USD','Tweedehands','img161482686844.jpg','<font class="Apple-style-span" color="#ff0010" size="5"><b>Arrow Tagging and Labelling Gun with Tagging Cables (approx. 2,300 left in box) EX<br></b></font><div><br></div><div><div class="iw"></div><div><font class="Apple-style-span" size="4"><b>Condition: </b>Excellent. Hardly used. Includes orginal boxes for products.</font></div><div><br></div><div><b><br></b></div><div><div><p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS"><b>Terms &amp; Conditions for Buying &amp; Shipping</b></p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">&nbsp;1) Every effort is made to describe the listed item and its condition accurately and honestly. If you have any have&nbsp;questions about an item we may have missed, please ask before you bid or buy.</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS"><b>2)&nbsp;PAYMENT:&nbsp;The winning bidder of an auction or buyer on a fixed price item must make payment within -3- days. Prompt payment is good business. If &nbsp;you shop anywhere else, locally or online, businesses require immediate payment. Get into that habit.&nbsp;Those who do not accept this responsibility will be issued an Unpaid Item notice (</b>after four days)<b>&nbsp;which will wreck your credibility on ebay. We''ve heard every excuse in the book for non-payment. Even if you are very creative, it won''t work on us.&nbsp;</b></p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">3)&nbsp;<b>INSURANCE:</b>&nbsp;On some items, insurance will be added into the handling charge. This will be indicated on the listing. Insurance will be charged for most international shipments. This tends to help make deliveries more reliable.</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">&nbsp;</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS"><b>&nbsp;SHIPPING&nbsp;</b></p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">4) Every item is packed to the very highest standard to ensure that your item is kept as&nbsp;safe as possible&nbsp;during shipping.&nbsp;&nbsp;</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">5) Shipping is charged at cost plus a reasonable handling charge to cover our cost of a box, packaging materials, tape, etc. Shipping discounts are available for multiple purchases made within a -3- day buying period. If you need a longer period, arrangements can be made under special circumstances (i.e.: holiday shopping).&nbsp;</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">6) A tracking number will be supplied with every order.&nbsp;</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">7) Your order will be shipped within 1-3 business days of receipt of your payment (business days = M-F excluding holidays) depending on our shipping schedule for the week.</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS; min-height: 21.0px"><br></p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">8) <b>Customer Service:</b> At any time, if you have any concerns or special needs for your order, please let us know immediately. Your satisfaction with our product and service is important to us. Good communication is essential. Please contact us before you do any feedback. We want you to be pleased with our service and product.</p>
<p style="margin: 0.0px 0.0px 0.0px 0.0px; font: 18.0px Trebuchet MS">9)&nbsp;<b>FEEDBACK:</b>&nbsp;We want this to be an excellent shopping experience for all involved with the hope that you will become a repeat shopper with us. Therefore, we value your opinions. Shortly after you receive your order from us and are satisfied with the product and our service, please take the time to offer us some feedback. After you have left feedback, we''ll do the same for you. We find that this method ensures that everyone is happy with the transaction.&nbsp;</p>
